import React, {useState} from 'react';
import './style/App.css';
import Header from './components/Header';
import Post from './components/Post';

function App() {

  const [posts, setPosts] = useState([
    {
      username: 'Barış Arslan',
      caption: 'Hello World!',
      imageUrl: 'https://www.freecodecamp.org/news/content/images/2021/06/Ekran-Resmi-2019-11-18-18.08.13.png'
    }
  ]);

  return (
    <div className="App">
      <Header />
      {
        posts.map(post => (
          <Post username={post.username} caption={post.caption} imageUrl={post.imageUrl}/>
        ))
      }

      <Post username="Barış Arslan" caption="Hello World!" imageUrl="https://www.freecodecamp.org/news/content/images/2021/06/Ekran-Resmi-2019-11-18-18.08.13.png"/>
      <Post username="Yasin Arslan" caption="Have a good day!" imageUrl="https://barisarslan.com.tr/style/img/barisarslan.jpg"/>
      <Post username="Ayşe Arslan" caption="Maybe good :(" imageUrl="https://www.freecodecamp.org/news/content/images/2021/06/Ekran-Resmi-2019-11-18-18.08.13.png" />
    </div>
  );
}

export default App;
